import React from 'react';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Navigate,
} from 'react-router-dom';

import Main from './Pages/Home/Home';
import Login from './Pages/Login/Login';
import Register from './Pages/Login/Register';
import Dashboard from './Pages/Dashboard/dashboard/dashboard.js';
import User from './Pages/Dashboard/user.js';
import ZapFeed from './Pages/Dashboard/ZapFeed/ZapFeed';
import Invoicing from './Pages/Dashboard/dedInvoicing/dedInvoicing.js';
import Campaigns from './Pages/Dashboard/Campaigns/campaigns';
import Search from './Pages/Dashboard/Search/search';
import BlitzPay from './Pages/BlitzPay/blitzpay.js';
import AddCreators from './Pages/Dashboard/Campaigns/addCreators.js'; // Adjust the path as necessary

const Home = React.lazy(() => import('./Pages/Home/Home'));

function App() {
  return (
          <Router>
              <Routes>
                <Route exact path="/" element={<Navigate to="/Home" />} />
                <Route path="/Home" element={<Main><Home /></Main>} />
                <Route path="/Login" element={<Login />} />
                <Route path="/Register" element={<Register />} />
                <Route path="/dashboard" element = {<Dashboard />} />
                <Route path="/User" element = {<User />} />
                <Route path="/ZapFeed" element = {<ZapFeed />} />
                <Route path="/invoicing" element = {<Invoicing />} />
                <Route path="/Campaigns" element = {<Campaigns />} />
                <Route path="/search" element = {<Search />} />
                <Route path="/blitzpay" element = {<BlitzPay />} />
                <Route path="/add-creators/:campaignId" element = {<AddCreators />} /> 
              </Routes>
          </Router>
  );
}

export default App;
